First, we can group the terms to simplify the expression a little:
-85*a*b*y - 61*a*b*y - 91*a*b*y + 58*a*b*y + 34*a*b*y - 49*a*b*y + a*b*y - 50*a*b*y.

Then we add and subtract them, being careful about negative and positive terms:
-85 - 61 = -146, so -146*a*b*y (which in modulo 100 is -46*a*b*y, since -146 modulo -100 = -46);
-91 + 58 = -33, so -33*a*b*y (which in modulo 100 is -33*a*b*y, since -33 modulo -100 = -33);
34 - 49 = -15, so -15*a*b*y (which in modulo 100 is -15*a*b*y, since -15 modulo -100 = -15);
1 - 50 = -49, so -49*a*b*y (which in modulo 100 is -49*a*b*y, since -49 modulo -100 = -49).

So, the expression is:
-46*a*b*y - 33*a*b*y - 15*a*b*y - 49*a*b*y
which equals -143*a*b*y (-46-33-15-49=-143), which in modulo 100 is -43*a*b*y (Since -143 modulo -100 = -43).
